import React, { useEffect, useState } from 'react'
import { Header } from './Header'

export const ProdductsList = () => {

    const url = "http://127.0.0.1:8000/api/lists";
    const [data, setData] = useState([]);

    const fetchInfo = () => {
        return fetch(url)
            .then((res) => res.json())
            .then((d) => setData(d))
    }


    useEffect(() => {
        fetchInfo();
    }, []);



    return (

        < div >

            <Header />

            {/* 
            <body>

                <header>
                    <h1>Smartphone Product List</h1>
                </header>

                <div class="product-container">
                    {
                        data.map((i) =>
                            <div class="product-card">
                                <img class="product-image" src={"http://127.0.0.1:8000/"+i.image} alt="iPhone" />
                                <div class="product-name">{i.name}</div>
                                <div class="product-name">{i.model_no}</div>
                                <div class="product-price">{i.price}</div>
                                <button class="delete-button">Delete</button>
                            </div>

                        )
                    }
                </div>

            </body> */}

            <body>

                <header>
                    <h1>Smartphone Product List</h1>
                </header>

                <div class="product-container">
                    <div class="product-card">
                        <img class="product-image" src="iphone.jpg" alt="iPhone" />
                            <div class="product-name">iPhone X</div>
                            <div class="product-price">$999</div>
                            <div class="button-container">
                                <button class="edit-button" onclick="editProduct(1)">Edit</button>
                                <button class="delete-button" onclick="deleteProduct(1)">Delete</button>
                            </div>
                    </div>

                    <div class="product-card">
                        <img class="product-image" src="samsung.jpg" alt="Samsung Galaxy" />
                            <div class="product-name">Samsung Galaxy S21</div>
                            <div class="product-price">$899</div>
                            <div class="button-container">
                                <button class="edit-button" onclick="editProduct(2)">Edit</button>
                                <button class="delete-button" onclick="deleteProduct(2)">Delete</button>
                            </div>
                    </div>


                </div>

                {/* <script>
                    function editProduct(productId) {
                        // Implement edit functionality here
                        alert("Edit Product " + productId);
  }

                    function deleteProduct(productId) {
                        // Implement delete functionality here
                        alert("Delete Product " + productId);
  }
                </script> */}

            </body>
        </div >
    )
}
